export function popUp(){const e=queryAll(".ext-popup");Array.from(e).forEach((e=>{eventPopUp(e)}))}function eventPopUp(e){let t;return t=e.addEventListener("click",(t=>{t.preventDefault(),window.open(e.href,e.title,"width=640,height=480,toolbar=0,status=0")})),t}function queryAll(e){return document.querySelectorAll(e)}